import * as React from 'react';
import './ContactsDisplay.css'



export default class ContactsSelect extends React.component {
    constructor(props) {
        super(props);
        this.state = {
          contacts: this.props.contacts,
        }
    }


    render() {



    return (
        <>
          <div className="members">
            <label>{this.state.contacts.username}</label>
            <input type="checkbox" id={this.state.contacts.id} value={this.state.contacts.email}/>
          </div>
        </>
        )
}
}
